import React from 'react';

function CartItem({ item }) {
  return (
    <div className="cart-item-container">
      <div>
        <img
          className="product-image-cart"
          src={`${item.photo}`}
          alt={item.name}
        />
      </div>
      <div>
        <p>{item.name}</p>
        <p>Price ${item.price}</p>
      </div>
    </div>
  )
}

export default CartItem;
